Consider the following C program:
```
#define assume(e) if(!(e)) return 0;
extern int unknown(void);
extern int unknown_int(void);

#include <assert.h>

int main() {
  int x = unknown_int();
  int y = unknown_int();

  if (!(x == y && y >=0)) return 0;
  while (x!=0) {
    x--;
    y--;
    if (x<0 || y<0) break;
  }
  {;//@ assert(y==0);
}
  return 0;
}
```
Output the loop invariants for the loop in the program above.
Let's think step by step.

First, note the pre-conditions and variable assignments in the program:
- int x = unknown_int();
- int y = unknown_int();
- if (!(x == y && y >=0)) return 0;

The pre-condition is that x == y and y >= 0.

Next, analyze the loop body and make a note of the loop condition.
The loop condition is x != 0.

Now, output loop invariants that are true before the loop execution, in every iteration of the loop, and after the loop termination:

```
/*@ 
    loop invariant x == y;
    loop invariant x >= 0;
    loop invariant y >= 0;
*/
```

These loop invariants imply the post-condition y == 0 after the loop termination.

